(31, 'Maravilhoso T4+1 MOBILADO no Condominio Chitala na Marginal', '<div style=\"\">Preparado para respirar o ar puro do Oceano Indico?<br>T4 + 1 todas Suites com Walk in Closet</div><div style=\"\">1 Office</div><div style=\"\">Sala de estar</div><div style=\"\">Sala de jantar</div><div style=\"\">2 cozinhas (dentro do apartamento e 1 para&nbsp; cozinheiros)</div><div style=\"\">1lavandaria</div><div style=\"\">Cozinha equipada (geleira dupla bosch)</div><div style=\"\">Micro ondas, forno</div><div style=\"\">Porta principal automatica com butao.</div><div style=\"\">Vista mar</div><div style=\"\">2 andar</div><div style=\"\">Climatizada</div><div style=\"\">Varanda enorme</div><div style=\"\">Guarda fatos enormes</div><div style=\"\">COM TODAS MOBILIAS</div><div style=\"\"><br></div><div style=\"\">Mobilada (o dono esta a comprar mobilias esta semana)</div><div style=\"\"><br></div><div style=\"\">Camaras de seguranca</div><div style=\"\">CCTV com conexao para a tv principal e na sala de controle dos guardas</div><div style=\"\"><br></div><div style=\"\">Casas de banho com acessorios de Alta qualidade</div><div style=\"\"><br></div><div style=\"\">Parque de estacionamento</div><div style=\"\">Para 2 Carros Grandes</div><div style=\"\">Ou 3 Pequenos</div>', 307000, 5, 5, 13, 0, 128, 'Clube Naval', '-25.976896', '32.59598289999997', 'e26a1f89938ed8c4b79e04860d0ad2e2.jpg', 'MZN', 'maravilhoso-t4-1-mobilado-no-condominio-chitala-na-marginal', 25, 2, 7, 4, '2018-04-05', '2019-05-28'),
(33, 'Escritorios na Sommershield, em frente a Clinicare', '<div style=\"\">Rua Angelo Azarias Chichava (Bairro da somershield) ,&nbsp;</div><div style=\"\">por detrás da Igreja d Sto António da Polana e em frente à Clinicare,&nbsp;</div><div style=\"\">aluguer p escritório com area d cerca d 270m2.&nbsp;</div><div style=\"\">O arrendamento pode ser feito sem ou com anexo.&nbsp;</div><div style=\"\">São 8 espaços/salas d tamanhos q variam de 9m2/12m2 a 32m2 , 2wc e um 3° c poliban. Alem destes espaços, existe um 9° q pode servir como café/barzinho.&nbsp;</div><div style=\"\">Disponibilidade imediata.</div><div style=\"\"><br></div><div style=\"\">VALOR: 2500 USD</div>', 150000, 8, 0, 20, 0, 248, 'Clinicare', NULL, NULL, 'e26a1f89938ed8c4b79e04860d0ad2e2.jpg', 'MZN', 'escritorios-na-sommershield-em-frente-a-clinicare', 31, 2, 7, 4, '2018-04-06', '2019-01-21'),
