(39, 'Preco Promocional T4 Condominio Janelas do Indico a 155.000Mzn', '2 pisos | 4 Quartos, 1 e suite; quartos com armarios embutidos |&nbsp;<div>4 Casas de banho |&nbsp;</div><div>Varanda Panoramica |&nbsp;</div><div>Sala de Visitas e de Jantar |&nbsp;</div><div>Cozinha americana equipada com eletrodomesticos de 1a Linha |&nbsp;</div><div>Todos comodos climatizados |&nbsp;</div><div>Area de Serviço | Jardim |&nbsp;</div><div>Estacionamento para dois | 281 a 396 m<sup>2</sup>&nbsp;de area&nbsp;</div><div>Segurança 24/7 com cameras monitoradas | Gerador e Estação&nbsp;de tratamentos de aguas | E muito mais Venha viver na sua casa de Sonho! Optima localização&nbsp;com facil acesso a diversos pontos da cidade de Maputo.&nbsp;</div><div><br></div><div>PROMOCAO DE 155.000 PROMOCAO UNICA VALIDA PARA O MES DE ABRIL</div><div><br></div><div>CODE C.C</div>', 155000, 4, 4, 12, 26, 237, 'DONA ALICE', '-25.9066178', '32.63690470000006', 'e26a1f89938ed8c4b79e04860d0ad2e2.jpg', 'MZN', 'preco-promocional-t4-condominio-janelas-do-indico-a-155-000mzn', 27, 2, 7, 4, '2018-04-06', '2019-05-28'),
(40, 'Moradia na Coop ao Lado da Escola da Coop', '<div style=\"\">Arrenda-se</div><div style=\"\"><br></div><div style=\"\">Vivenda com 4 pisos, 4 wc\'s, 9 compartimentos incluindo recepção e sala de reuniões.</div><div style=\"\"><br></div><div style=\"\">NB: para escritório</div><div style=\"\"><br></div><div style=\"\">80.000&nbsp; mt&nbsp;</div><div style=\"\">Coop</div><div style=\"\"><br></div><div style=\"\"><br></div>', 80000, 8, 4, 13, 16, 25, 'Coop Rua B', '-25.9574863', '32.58627999999999', 'e26a1f89938ed8c4b79e04860d0ad2e2.jpg', 'MZN', 'moradia-na-coop-ao-lado-da-escola-da-coop', 45, 2, 7, 4, '2018-04-06', '2019-01-16'),
