(735, 'ARRENDA-SE Luxuosa Triplex T4/2Suítes Na Sommerschield 1, Em  frente ao Comité Central do Partido Frelimo', '<div style=\"\">ARRENDA-SE Luxuosa Triplex T4/2Suítes Na Sommerschield 1, Em&nbsp; frente ao Comité Central do Partido Frelimo</div><div style=\"\"><br></div><div style=\"\">RENDA: USD 3,000.00 (Negociáveis)</div><div style=\"\">REF: VPA1439</div><div style=\"\">LOCALIZAÇÃO: Bairro da Sommerschield 1, Rua da FRELIMO</div><div style=\"\">DISPONIBILIDADE: Imediata</div><div style=\"\">PROXIMIDADE:&nbsp; Comité Central do Partido Frelimo, Clinica da Sommerschield, BIM, BCI, Banco Único</div><div style=\"\"><br></div><div style=\"\">Ideal para uma família que procura segurança, paz e tranquilidade na Cidade de Maputo</div><div style=\"\"><br></div><div style=\"\">Esta Luxuosa e deslumbrante casa climatizada oferece 4 quartos, sendo 2 deles com casa de banho privativa, varanda, 2 banheiro, sala de jantar, sala de estar, Escritório, cozinha moderna.</div><div style=\"\"><br></div><div style=\"\">O imóvel está em excelente estado de conservação, numa zona que oferece diversas opções de serviços e lazer, como escolas (a 1min), farmácias (1min), padarias, merceárias (a 1 min), shopping (a 3 min).</div><div style=\"\"><br></div><div style=\"\">Ainda dispõe de estacionamento para 4 viaturas, piscina privada, ideal para receber seus amigos e familiares,&nbsp; cozinha exterior, lavandaria, anexo e uma casa de banho de serviço.</div><div style=\"\"><br></div><div style=\"\">Apesar de ser uma zona segura e calma, o imóvel possui sistema de 2 x portões automáticos.</div><div style=\"\"><br></div><div style=\"\"><br></div><div style=\"\">Não hesite, contacte-nos e agende a sua visita, teremos o maior prazer em ajudar.</div><div style=\"\"><br></div><div style=\"\">Para mais informações</div>', 180000, 4, 0, 12, 30, 279, 'Bairro da Sommerschield 1, Rua da FRELIMO', '-25.9593806', '32.595942000000036', 'e26a1f89938ed8c4b79e04860d0ad2e2.jpg', 'MZN', 'arrenda-se-luxuosa-triplex-t4-2suites-na-sommerschield-1-em-frente-ao-comite-central-do-partido-frelimo', 1, 2, 6, 4, '2019-02-20', '2019-06-26'),
